import React, { Component } from 'react';

class BillSummary extends Component {

    constructor(props){
        super(props);

        this.state = {
            itemList: this.props.location.state
        }
    }

 /*   componentDidMount(){
        axios.get("http://localhost:5050/")
    }*/

    render() {
        return (
            <div className="billTable btn-success">
                <table class="table">
                    <thead>
                        <tr>
                            <th scope="col">Vegetable</th>
                            <th scope="col">Quantity</th>
                            <th scope="col">Cost</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                        <th scope="row">1</th>
                            <td>Mark</td>
                            <td>Otto</td>
                        </tr>
                        <tr>
                        <th scope="row">2</th>
                            <td>Jacob</td>
                            <td>Thornton</td>
                        </tr>
                        <tr>
                        <th scope="row">3</th>
                            <td>Larry</td>
                            <td>the Bird</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        )
    }

}

export default BillSummary;
